#include "mod.h"
class Solution {
public:
    vector<string> findRepeatedDnaSequences(string s) {
        set<string>path;
        set<string>ret;
        int len=s.size()-9;
        for(int i=0; i<len; ++i){
            string cur=s.substr(i, 10);
            if(path.find(cur)==path.end())path.insert(cur);
            else ret.insert(cur);
        }
        return vector<string>(ret.begin(), ret.end());
    }
};

int main(){
    string s="";
    Solution test;
    vector<string>ret=test.findRepeatedDnaSequences(s);

    for(string s:ret)cout<<s<<endl;
    return 0;
}